import React from "react";

const Weather = () => {
  return (
    <div>
      {this.props.city && (
        <div>
          <p>
            Location: {this.props.city}, {this.props.country}
          </p>
          <p>Temperature: {this.props.temp}</p>
          <p>Sunrise: {this.props.sunrise}</p>
          <p>Sunset: {this.props.sunset}</p>
        </div>
      )}
      <p>{this.props.error}</p>
    </div>
  );
};
export default Weather;
